using System.Net;
using System.Net.Http;
using System.Threading.Tasks;

namespace RestServiceWrapper
{
    public class RestClient
    {
        private readonly string _baseUrl;
        private readonly string _authToken;

        public RestClient(string baseUrl, string authToken)
        {
            _baseUrl = baseUrl;
            _authToken = authToken;
        }

        public async Task<T> GetAsync<T>(string uri)
        {
            var client = new HttpClient();
            client.DefaultRequestHeaders.Add("Authorization", "Bearer " + _authToken);

            var response = await client.GetAsync(uri);
            var content = await response.Content.ReadAsStringAsync();
            return await Task.FromResult(JsonSerializer.Deserialize<T>(content));
        }

        public async Task<T> PostAsync<T>(string uri, object data)
        {
            var client = new HttpClient();
            var content = JsonConvert.SerializeObject(data);

            var response = await client.PostAsync(uri, content);
            var contentString = await response.Content.ReadAsStringAsync();
            return await Task.FromResult(JsonSerializer.Deserialize<T>(contentString));
        }
    }
}
```

**Usage:**

